            DEOPT_IF(!PyUnicode_CheckExact(left), COMPARE_AND_BRANCH);
            DEOPT_IF(!PyUnicode_CheckExact(right), COMPARE_AND_BRANCH);
            STAT_INC(COMPARE_AND_BRANCH, hit);
